static inline uint64_t bf_tofino_read_32b_counter(bf_dev_id_t devid, int pipe, int port, uint32_t offset)
{
    (void)port;
    (void)pipe;
    uint32_t  cnt = 0;
    lld_read_register(devid,  offset, &cnt);
    return((uint64_t)cnt);
}


static inline uint64_t bf_tofino_read_64b_counter(bf_dev_id_t devid, int pipe, int port, uint32_t offset)
{
    (void)port;
    (void)pipe;
    uint64_t  cnt = 0, reg_cnt;
    uint32_t  val;
    lld_read_register(devid, offset, &val);
    reg_cnt = val;
    cnt = (reg_cnt << 0) + cnt;
    lld_read_register(devid, offset + 4, &val);
    reg_cnt = val;
    cnt = (reg_cnt << 32) + cnt;
    return(cnt);
}




